import { nanoid } from "nanoid";
import { useState } from "react";
import Square from "./Square";

export default function Row(props) {

    const row = props.row.map(square => {
        if(square == true) {
            return (
                <Square 
                    value={true}
                    key={'square-'+nanoid()}
                />
            );
        } else {
            return (
                <Square 
                    value={false}
                    key={'square-'+nanoid()}
                />
            );
        }
    });

    return (
        <div className="board-row">
            {console.log(props.row)}
        </div>
    );
}
